import React from "react";

const transaction = () => {
	return (
		<div>
			<h1>Add Transaction</h1>
			<div>
				<form>
					<p>Name</p>
					<input />
					<p>Transaction Type</p>
					<select>
						<option value="Income">Income (+)</option>
						<option value="Expenses">Expense (-)</option>
					</select>
				</form>
			</div>
		</div>
	);
};

export default transaction;
